import React from 'react'
import { StyleSheet, Text, View  , TouchableOpacity} from 'react-native'
import {IconHome , IconjadwalAktif
     , IconUserAktif , IconUser ,
      IconHomeAktif , IconJadwal } from '../../assets/icons' 



const TabItem = ({isFocused , onLongPress , onPress , label}) => {
    const Icon = () => {
        if(label == "Home"){
            return (<IconHomeAktif />);
        }

        if(label == "Jadwal"){
            return (<IconjadwalAktif />);
        }

        if(label == "User"){
            return (<IconUserAktif />);
        

    }
}

    return (
        <TouchableOpacity
        onPress={onPress}
        onLongPress={onLongPress}
        style={{ flex: 1 }}>
        <Icon />
        <Text style={{ color: isFocused ? '#673ab7' : '#222' }}>
          {label}
        </Text>
      </TouchableOpacity>
    )
}

export default TabItem

const styles = StyleSheet.create({})
